import './Video.css'
import { PlayVideo } from '../../Components/PlayVideo/PlayVideo'
import { Recommended } from '../../Components/Recommended/Recommended'
export const Video = () => {
  return (
    <div className='play-container'>
       <PlayVideo/>
       <Recommended/>
    </div>
  )
}
